import logo from "./logo.svg";
import "./App.css";
import { ToDoBoard } from "./features/todoList/ToDoBoard";
import * as React from "react";
import Box from "@mui/material/Box";

function App() {
  return (
    <Box
      sx={{
        border: 1,
        width: 3 / 4,
        borderColor: "primary.main",
        mx: "auto",
        mt: 6,
        alignItems: { textAlign: "center" },
      }}
      id="App"
    >
      <ToDoBoard />
    </Box>
  );
}
export default App;
